import "./styles/app.scss"
import Canvas from "./components/Canvas";
import Toolbar from "./components/Toolbar";
import SettingBar from "./components/SettingBar";
import {BrowserRouter} from "react-router-dom";

function App() {
    return (
       <BrowserRouter>
           <div className="App">
               <Toolbar/>
               <SettingBar/>
               <Canvas/>
           </div>
       </BrowserRouter>
    );
}

export default App;
